import React from "react";
import './MovieRow.css';

export default ({title, items}) => {
    return (
        <div>
            <h2>{title}</h2>
            <div className="movieRow--listarea">
            <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fassets.stickpng.com%2Fimages%2F580b57fcd9996e24bc43c529.png&imgrefurl=https%3A%2F%2Fwww.stickpng.com%2Fpt-br%2Fimg%2Ficones-logos-emojis%2Fempresas-tecnicas%2Flogotipo-da-netflix&tbnid=5hi3e7TCiyFvgM&vet=12ahUKEwi_jpSK9OD8AhWzu5UCHQ9ICSYQMygAegUIARCyAQ..i&docid=fiM3d4PkEFLb4M&w=2560&h=1440&q=netflix%20png&hl=pt-BR&ved=2ahUKEwi_jpSK9OD8AhWzu5UCHQ9ICSYQMygAegUIARCyAQ"></img>
            </div>
        </div>
 
 );
 
}
